import $ from "jquery";


function getJsonData(fileURL) {
    let jsonData;

    $.ajax({
        url: fileURL,
        async: false,
        dataType: "json",
        success: function(response) {
            jsonData = response;
        }
    });

    return jsonData;
}

let elementData;

$.ajax({
    url: "./ElementData.json",
    async: false,
    dataType: "json",
    success: function (response) {
        jsonData = response;
    }
});


export default elementData
